import { Button, HStack, Heading, Image, Text, VStack } from "@chakra-ui/react";
import { TomotimeHeader } from "../Components/Header";
import { ZigzagPattern } from "../Components/Snake";
import { useNavigate } from "react-router-dom";

export default function Home() {
  const navigate = useNavigate();

  return (
    <VStack mt={20}>
      <VStack mb={20}>
        <Heading fontFamily="heading" fontWeight="black">
          Selfie Snake
        </Heading>
        <Text fontSize="xl">
          by{" "}
          <Text display="inline" fontWeight="semibold" color="brand">
            tomotime
          </Text>
        </Text>
      </VStack>

      <Button
        variant="solid"
        bg="blue.50"
        _hover={{ bg: "blue.100" }}
        color="brand"
        borderRadius={15}
        onClick={() => navigate("/create")}
      >
        Create a snake!
      </Button>
      <Button
        variant="solid"
        bg="blue.50"
        _hover={{ bg: "blue.100" }}
        color="brand"
        borderRadius={15}
      >
        View my snake
      </Button>

      {/* <ZigzagPattern imageUrls={images} /> */}
    </VStack>
  );
}
